@diame SSV1 SS v1 and v2 are not copy protections, they are methods of reading and copying the disc (or at least part of the disc). Kreon drives use SS v1 and iXtreme drives use SS v2. So if a game is ripped using a Kreon drive, it will have SS v1 and if it's ripped with an iXtreme drive it will have SS v2. There is no way to "upgrade" to SS v2 if you have an SS v1, all you can hope to do to change it is re-rip the game with aniXtreme drive and patch the newly ripped SS into the old ISO. 

